class.haxe_doc:
An Array is a storage for values. You can access it using indexes or
	with its API.

	@see https://haxe.org/manual/std-Array.html
	@see https://haxe.org/manual/lf-array-comprehension.html

abstract.haxe_doc:
An abstract type that represents a Class.

	See `Type` for the Haxe Reflection API.

	@see https://haxe.org/manual/types-class-instance.html

An abstract type that represents any enum value.
	See `Type` for the Haxe Reflection API.

	@see https://haxe.org/manual/types-enum-instance.html

The standard `Int` type. Its precision depends on the platform.

	On static targets, `null` cannot be assigned to `Int`. If this is necessary,
	`Null<Int>` can be used instead.

	`Std.int` converts a `Float` to an `Int`, rounded towards 0.
	`Std.parseInt` converts a `String` to an `Int`.

	@see https://haxe.org/manual/types-basic-types.html
	@see https://haxe.org/manual/std-math-integer-math.html
	@see https://haxe.org/manual/types-nullability.html

The standard Boolean type, which can either be `true` or `false`.

	On static targets, `null` cannot be assigned to `Bool`. If this is necessary,
	`Null<Bool>` can be used instead.

	@see https://haxe.org/manual/types-bool.html
	@see https://haxe.org/manual/types-nullability.html

`Dynamic` is a special type which is compatible with all other types.
Use of `Dynamic` should be minimized as it prevents several compiler checks and optimizations. See `Any` type for a safer alternative for representing values of any type.
@see https://haxe.org/manual/types-dynamic.html

typedef.haxe_doc:
An `Iterator` is a structure that permits iteration over elements of type `T`.
Any class with matching `hasNext()` and `next()` fields is considered an `Iterator` and can then be used e.g. in `for`-loops. This makes it easy to implement custom iterators.
@see https://haxe.org/manual/lf-iterators.html

An `Iterable` is a data structure which has an `iterator()` method.
	See `Lambda` for generic functions on iterable structures.

	@see https://haxe.org/manual/lf-iterators.html

class.haxe_doc:
`ArrayAccess` is used to indicate a class that can be accessed using brackets. The type parameter represents the type of the elements stored.
This interface should be used for externs only. Haxe does not support custom array access on classes. However, array access can be implemented for abstract types.
@see https://haxe.org/manual/types-abstract-array-access.html

abstract.haxe_doc:
The unsigned `Int` type is only defined for Flash and C#.
	Simulate it for other platforms.

	@see https://haxe.org/manual/types-basic-types.html

Complex - A Complex Float Type.  
   { x, y }

   For Convinence you can declare in several ways eg:  
   var c0: Complex = '1 + 2i';  
   var c1: Complex = { real: 1., imaginary: 2. };  
   var c2: Complex = { r: 1., i: 2. };  
   var c3: Complex = new Complex({ x: 1., y: 2. });  

   You can use normal operations  
   var c4 = c0 * c1;  
   var c5 = c0 + c1;  

   You can extract either part  
   var real = c0.real;  
   var imaginary = c0.i;  

   You can trace it.
   trace( Complex.fromString( c0 ) ); // '1. + 2. i'

   Trig functions are contained in geom.curve.ComplexTrig, but do not have tests beyond compile.

fromString.haxe_doc:
* <pre><code>
     * >>> ({ 
     * ... var c0: Complex = '1 + 2i';
     * ... var c1 = new Complex({ x: 1., y: 2. });
     * ... c1 == c0; }) == true
     * </code></pre>

